import PageTitle from "../../components/pagetitle/PageTitle";
import ProgressContainer from "../../components/progress/ProgressContainer";
import ProgressItem from "../../components/progress/ProgressItem";

function AboutPage() {
    return(
        <div className="pages container" id="aboutPage">
            <PageTitle title="HakkÄ±mda" />
            <div className="pageContent">
                <p>Lorem ipsum dolor sit amet consectetur adipisicing elit. Veritatis qui, eaque nesciunt delectus amet vero. Ipsum aliquam quasi natus pariatur.</p>
                <ProgressContainer>
                    <ProgressItem from="0" to="85" speed="1500" />
                    <ProgressItem from="0" to="60" speed="1500" />
                    <ProgressItem from="0" to="90" speed="1500" />
                    <ProgressItem from="0" to="78" speed="1500" />
                </ProgressContainer>
            </div>
        </div>
    );    
}
export default AboutPage;
